import React from "react";
import axios from "axios";

class Photo extends React.Component {
  constructor() {
    super();
    this.state = {
      photos: [],
    };
  }

  componentDidMount() {
    axios
      .get("http://127.0.0.1:8000/api/photo")
      .then((res) => {
        console.log(res);
      })
      .catch((error) => {
        console.log(error.response);
      });
  }

  render() {
    return (<>Composant photos</>);
  }
}
export default Photo;
